import styled from "styled-components";
import "@fontsource/space-grotesk";

export const ContainerSkills = styled.div`
    display: flex;
`;

export const TextTitle = styled.a`
    font-family: 'Inter';
    font-style: normal;
    font-weight: 700;
    color: ${props => props.theme.colors.text};
    font-size: 50px;
`;
